import React, { useState, useEffect, useContext, useRef } from "react";
import { useHistory } from "react-router-dom";
import { Link } from 'react-router-dom';
import axios from 'axios';
import swal from 'sweetalert';
import Stitch from "../components/images/stitch.js";
import Minnie from "../components/images/minnie.js";
import Ariel from "../components/images/ariel.js";
import R2D2 from "../components/images/r2d2.js";
import Cat from "../components/images/cheshireCat.js";
import YODA from "../components/images/yoda.js";
export default function ShowcaseImageCard(props) {
  const [image, setImage] = useState({});
  const history = useHistory();

  useEffect(() => {
    setImage(props.userImage)
  }, [props])

  return (
    <div className="image-card">
      {image.component === "stitch" ?
        <div>
          <Stitch component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        image.component === "ariel" ?
        <div>
          <Ariel component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        image.component === "r2d2" ?
        <div>
          <R2D2 component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        image.component === "cat" ?
        <div>
          <Cat component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        image.component === "yoda" ?
        <div>
          <YODA component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        image.component === "minnie" ?
        <div>
          <Minnie component={image.component} onFill={()=>{}} fillColors={image.fill_colors} />
        </div> :
        <>Start coloring so your works can be here!</>
      }
    </div>
  )
}
